The 100th run of the Loudon classic is definitely one to remember. Not sure if we will be back, 55 grand for the winner, Bad weather, 14 red flags and restarts, plenty of jump starts, timing not working correctly and to many other things going on. My hats off to @bouldermotorsports for bringing a weapon of a machine for me to race in this historical race, we had the Pirobon x80 working flawless by Qualifying and was able to put down a time of 1.10.9 just .3 seconds off pole. The rain came down on Saturday non stop so that’s what we got for the race, after 2 hours of racing to complete 20 laps with 14 red flags in between was a bit frustrating to say the least, the race ended on a red flag after we were all told the race had to be completed on a checkered flag. Ended up P7 when I was running 5th on the last go. On a good note happy we went out there on a very unknown and special motorbike and be competitive on it against all the best and fast SuperSport dudes and teams in the USA. Thank you to everyone that make all this racing possible, this year has been a blast learning and improving on my riding. Next up is the @theridgemotorsportspark with @motoamerica.

@fastglass.media always killing it with the 📽️📽️

